import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import react from "react.js"
 export default function App (){
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Players />} />
        <Route path="/contest" element={<Contest />} />
      </Routes>
    </Router>
  );
};
